import React from 'react';
import './MultiItemCarousel.css'

import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';

import pic1 from '../images/multiCarousel/c1.jpg'
import pic2 from '../images/multiCarousel/c2.jpg'
import pic3 from '../images/multiCarousel/c3.jpg'
import pic4 from '../images/multiCarousel/c4.jpg'
import pic5 from '../images/multiCarousel/c5.jpg'
import pic6 from '../images/multiCarousel/c6.jpg'



const MultiItemCarousel = () => {

    const responsive = {
        desktop: {
            breakpoint: { max: 3000, min: 1024 },
            items: 6,
            slidesToSlide: 1, // optional, default to 1.
        },
        tablet: {
            breakpoint: { max: 1024, min: 464 },
            items: 4,
            slidesToSlide: 1, // optional, default to 1.
        },
        mobile: {
            breakpoint: { max: 464, min: 0 },
            items: 2,
            slidesToSlide: 1, // optional, default to 1.
        },
    };

    return (
        <div>
            <Carousel
                swipeable={true}
                draggable={true}
                showDots={false}
                responsive={responsive}
                // ssr={true} // means to render carousel on server-side.
                infinite={false}

                // autoPlaySpeed={1000}
                keyBoardControl={true}
                customTransition="all .5"
                transitionDuration={500}
                containerClass="carousel-container"
                // removeArrowOnDeviceType={["tablet"]}

                dotListClass="custom-dot-list-style"
                itemClass="carousel-item-padding-40-px"
            >
                <div>
                    <img src={pic1} alt="" style={{height: '160px'}}/>
                    <div className="carousel-caption-multi d-block text-center ">
                        <h5>relaxing</h5>
                        <p>relaxing</p>
                    </div>
                </div>
                <div>
                    <img src={pic2} alt="" style={{height: '160px'}}/>
                    <div className="carousel-caption-multi text-center d-block">
                        <h5>running</h5>
                        <p>running</p>
                    </div>
                </div>
                <div>
                    <img src={pic3} alt="" style={{height: '160px'}}/>
                    <div className="carousel-caption-multi text-center d-block ">
                        <h5>Club Hits</h5>
                        <p>Club Hits</p>
                    </div>
                </div>
                <div>
                    <img src={pic4} alt="" style={{height: '160px'}}/>
                    <div className="carousel-caption-multi text-center d-block">
                        <h5>TODAY'S</h5>
                        <p>TOP HITS</p>
                    </div>
                </div>
                <div>
                    <img src={pic5} alt="" style={{height: '160px'}}/>
                    <div className="carousel-caption-multi text-center d-block">
                        <h5>traffic</h5>
                        <p>traffic</p>
                    </div>
                </div>
                <div>
                    <img src={pic6} alt="" style={{height: '160px'}}/>
                    <div className="carousel-caption-multi text-center d-block">
                        <h5>CLASSIC</h5>
                        <p>oldies</p>
                    </div>
                </div>
            </Carousel>
        </div>
    );
};

// <div>
//     <img src={pic1} alt=""/>
//     Item 1
