// <div>
// <img src={pic2} alt=""/>
//     Item 1
// </div>
// <div>
//     <img src={pic3} alt=""/>
//     Item 1
// </div>
// <div>
// <img src={pic4} alt=""/>
//     Item 1
// </div>

export default MultiItemCarousel;
